import React, { useState, useEffect } from 'react';
import HeartRainAnimation from '../components/HeartRainAnimation';

// ViewSwitcher component for map states
function MapViewSwitcher({ activeState, onChange }) {
  const states = [
    { id: 'home', label: 'En casa', emoji: 'üè†' },
    { id: 'traveling', label: 'De camino', emoji: 'üöÄ' },
    { id: 'together', label: 'Juntos', emoji: 'üíñ' }
  ];

  return (
    <div className="flex bg-gray-100 rounded-xl p-1">
      {states.map(state => (
        <button
          key={state.id}
          onClick={() => onChange(state.id)}
          className={`flex-1 py-2 px-3 rounded-lg text-sm font-medium transition-all ${
            activeState === state.id
              ? 'bg-white text-rose-600 shadow-sm'
              : 'text-gray-600 hover:text-gray-900'
          }`}
        >
          <span className="mr-1">{state.emoji}</span>
          {state.label}
        </button>
      ))}
    </div>
  );
}

// Traveling animation component
function TravelingAnimation() {
  return (
    <div className="flex items-center justify-center py-8">
      <div className="relative">
        <div className="text-6xl animate-bounce">üöÄ</div>
        <div className="absolute -top-2 -right-2 text-2xl animate-pulse">‚ú®</div>
        <div className="absolute -bottom-2 -left-2 text-2xl animate-pulse delay-300">‚ú®</div>
      </div>
      <div className="ml-4 text-center">
        <div className="text-lg font-semibold text-gray-900 mb-1">De camino...</div>
        <div className="text-sm text-gray-600">¬°Pronto estaremos juntos!</div>
      </div>
    </div>
  );
}

export default function MapPage() {
  const [currentState, setCurrentState] = useState(() => {
    return localStorage.getItem('mapState') || 'home';
  });
  const [showHeartRain, setShowHeartRain] = useState(false);

  // Fixed distance between the two addresses
  const fixedDistance = 625; // km between Barcelona and Madrid

  // Save state to localStorage when it changes
  useEffect(() => {
    localStorage.setItem('mapState', currentState);

    // Show heart rain animation when "together" is selected
    if (currentState === 'together') {
      setShowHeartRain(true);
    } else {
      setShowHeartRain(false);
    }
  }, [currentState]);

  const renderContent = () => {
    switch (currentState) {
      case 'home':
        return (
          <div className="text-center py-8">
            <div className="text-6xl mb-4">üè†</div>
            <div className="text-sm text-gray-600 mb-2">Distancia</div>
            <div className="text-3xl font-semibold text-rose-600 mb-2">{fixedDistance} km</div>
            <div className="text-sm text-gray-500">
              Barcelona ‚Üî Madrid
            </div>
          </div>
        );

      case 'traveling':
        return <TravelingAnimation />;

      case 'together':
        return (
          <div className="text-center py-8">
            <div className="text-6xl mb-4">üíñ</div>
            <div className="text-lg font-semibold text-rose-600 mb-1">¬°Juntos!</div>
            <div className="text-sm text-gray-600">Distancia: 0 km</div>
          </div>
        );

      default:
        return null;
    }
  };

  return (
    <div className="space-y-4 relative">
      <div className="card">
        <div className="text-sm text-gray-600 mb-3">Estado actual</div>
        <MapViewSwitcher 
          activeState={currentState} 
          onChange={setCurrentState} 
        />
      </div>

      <div className="card">
        {renderContent()}
      </div>

      {/* Heart rain animation for "together" state */}
      {showHeartRain && (
        <HeartRainAnimation 
          type="fireworks" 
          isActive={true}
          onStop={() => setShowHeartRain(false)}
        />
      )}
    </div>
  );
}
